import React from "react";
import NoteContext from "./notesContext";

const NoteState = (props) => {
    const state = {
        "name": "Harry",
        "class": "5"
    }
    return (
        <NoteContext.Provider value={state}>
            {props.children}
        </NoteContext.Provider>
    )
}

export default NoteState;
